import React, { useState } from 'react';
import "./infologin.scss";

const Infologin = () => {


    return (
        <div className='info'>
            <img src={tutorialData[currentPage].imageSrc} alt="Tutorial Step" />
            <p>{tutorialData[currentPage].text}</p>
            <button>
                Previous
            </button>
            <button >
                Next
            </button>
        </div>
    )
}

export default Infologin;
